import React, { Component } from "react";
import IntlMessages from "../../../../util/IntlMessages";
import _ from "lodash";
import { connect } from "react-redux";
import moment from "moment";
import Button from "@material-ui/core/Button";
import testImg from "../classVitual.jpg";
import PassLevelTest from "./PassLevelTtest";
import PassTestConfirm from "./PassTestConfirm";
import { classService } from "../../../../_services/class.service";
import Exercices from "./Exercices";
const roleIdParent = 4;
const roleIdStudent = 5;
class TestStudentItem extends Component {
  constructor(props) {
    super(props);
    this.state = {
      menuState: false,
      itemId: 0,
      modifModal: false,
      deleteIsopen: false,
      anchorEl: undefined,
      ClassVirtualObject: {},
      openModalConfirm: false,
      openModalPass: false,
      listQuestion: [],
      access: "",
      openModalScore: false,
      openExercices: false,
      listeExercices: [],
    };
    this.handleShow = this.handleShow.bind(this);
    this.cancelModal = this.cancelModal.bind(this);
    this.handleDeleteClassVirtual = this.handleDeleteClassVirtual.bind(this);
    this.handleShowDeleteModal = this.handleShowDeleteModal.bind(this);
    this.closePassTestModal = this.closePassTestModal.bind(this);
    this.openPassTestModal = this.openPassTestModal.bind(this);
    this.closeConfirmModal = this.closeConfirmModal.bind(this);
    this.openConfirmModal = this.openConfirmModal.bind(this);
    this.openExercicesModal = this.openExercicesModal.bind(this);
    this.closeExerciceModal = this.closeExerciceModal.bind(this);
  }
  openConfirmModal = () => {
    this.setState({ openModalConfirm: true });
  };
  closeExerciceModal = () => {
    this.setState({ openExercices: false });
  };
  openExercicesModal = () => {
    this.setState({ openExercices: true });
    let apiEndpoint =
      `/exercices?access_token=${localStorage.token}&filter[where][id_subject]=` +
      this.props.test.subjects.id;
    classService
      .get(apiEndpoint)
      .then((response) => {
        var difficulty;
        this.props.score <= 30
          ? (difficulty = "easy")
          : this.props.score <= 70
          ? (difficulty = "medium")
          : (difficulty = "hard");
        const listeExercices = response.data.filter(
          (item) => item.difficulty == difficulty
        );
        this.setState({ listeExercices });
      })
      .catch((err) => {});
  };
  closeConfirmModal = () => {
    this.setState({ openModalConfirm: false });
  };

  openPassTestModal = () => {
    let apiEndpoint =
      `/test_questions?access_token=${localStorage.token}&filter[where][id_test]=` +
      this.props.test.id +
      `&filter[include][test_questions]=question_proposals`;
    classService
      .get(apiEndpoint)
      .then((response) => {
        const listQuestion = response.data.filter((item) => item.status);
        this.setState({ listQuestion });
      })
      .catch((err) => {});
    this.setState({ openModalConfirm: false, openModalPass: true });
  };
  closePassTestModal = () => {
    this.setState({
      openModalPass: false,
      listQuestion: [],
      openModalScore: true,
    });
  };
  handleShowDeleteModal = () => {
    this.setState({ menuState: false, deleteIsopen: true });
  };

  handleDeleteClassVirtual = () => {
    this.props.deleteClassVirtual(this.state.ClassVirtualObject.id);
    this.setState({ deleteIsopen: false });
  };

  cancelModal() {
    this.setState({ modifModal: false, deleteIsopen: false });
  }
  handleShow() {
    this.setState({
      modifModal: true,
      menuState: false,
    });
  }

  onOptionMenuSelect = (event) => {
    this.setState({
      menuState: true,
      anchorEl: event.currentTarget,
    });
  };
  handleRequestClose = () => {
    this.setState({ menuState: false });
  };

  render() {
    var currentDay = moment();
    var limitDate = moment(this.props.test.limit_date).add(1, "day");
    var access = currentDay.diff(limitDate) < 0;
    let test = this.props.test;
    let passed_date = this.props.passed_date;
    let score = this.props.score;
    let studentData = this.props.studentData;

    if (score == undefined) {
      return (
        <div className="col-xl-3 col-md-3 col-lg-3 col-sm-6 col-12 ">
          {this.state.openModalPass === true ? (
            <PassLevelTest
              openModalPass={this.state.openModalPass}
              closePassTestModal={this.closePassTestModal}
              test={test}
              listQuestion={this.state.listQuestion}
            />
          ) : (
            ""
          )}
          {this.state.openModalConfirm === true ? (
            <PassTestConfirm
              openModalConfirm={this.state.openModalConfirm}
              closeModalConfirm={this.closeConfirmModal}
              openPassTestModal={this.openPassTestModal}
              limitDate={test.limit_date}
            />
          ) : (
            ""
          )}

          <div
            className="card product-item  "
            style={{
              borderTopLeftRadius: "20px",
              borderTopRightRadius: "20px",
              borderBottomLeftRadius: "20px",
              borderBottomRightRadius: "20px",
            }}
          >
            <div
              className="card-header border-0 p-0"
              style={{
                borderTopLeftRadius: "20px",
                borderTopRightRadius: "20px",
              }}
            >
              <div className="card-image">
                <div className="grid-thumb-equal">
                  <span className="grid-thumb-cover jr-link">
                    <img alt="Remy Sharp" src={testImg} />
                  </span>
                </div>
              </div>
            </div>
            <div className=" d-flex flex-column bd-highlight">
              <div className="d-flex flex-row bd-highlight  d-flex justify-content-around align-items-center pt-1">
                {this.props.userProfile.role_id == roleIdParent ? (
                  <h3 style={{ fontWeight: "bold", color: "#4C19A9" }}>
                    {studentData.user.name + " " + studentData.user.surname}
                  </h3>
                ) : (
                  ""
                )}

                <div
                  className={
                    access
                      ? "badge text-uppercase  text-white bg-warning"
                      : "badge text-uppercase  text-white bg-danger"
                  }
                >
                  {access ? (
                    <IntlMessages id="level.test.pass" />
                  ) : (
                    <IntlMessages id="level.test.NoAccessible" />
                  )}
                </div>
              </div>
              <div className="bd-highlight  flex-column bd-highlight">
                <div className=" bd-highlight  d-flex flex-row  justify-content-between align-items-center pl-2">
                  <h6 style={{ fontWeight: "bold", color: "#4C19A9" }}>
                    <IntlMessages id="level.test.name" />: {test.test_name}
                  </h6>
                </div>

                <div className="bd-highlight  d-flex flex-row  justify-content-between align-items-center pl-2">
                  <h6 style={{ fontWeight: "bold", color: "#4C19A9" }}>
                    <IntlMessages id="components.note.subject" /> :{" "}
                    {test.subjects.name_FR}
                  </h6>
                </div>
                <div className="bd-highlight  d-flex flex-row  justify-content-between align-items-center pl-2">
                  <h6 style={{ fontWeight: "bold", color: "#4C19A9" }}>
                    <IntlMessages id="level.test.date" />:{" "}
                    {moment(test.limit_date).format("DD/MM/YYYY")}
                  </h6>
                </div>
                <div className="bd-highlight  d-flex flex-row  justify-content-start align-items-center pl-2">
                  <h6 style={{ fontWeight: "bold", color: "#4C19A9" }}>
                    <IntlMessages id="level.test.duration" /> :{" "}
                    {test.test_duration}{" "}
                    <IntlMessages id="level.test.minutes" />
                  </h6>
                </div>
              </div>
              <div className="d-flex flex-row bd-highlight  justify-content-start ml-0 ">
                <div className="d-flex flex-row  col-md-12 pl-0 pr-0 justify-content-between ">
                  {this.props.userProfile.role_id == roleIdParent ? (
                    <Button
                      variant="contained"
                      fullWidth={true}
                      style={{
                        borderBottomLeftRadius: "20px",
                        borderBottomRightRadius: "20px",
                        backgroundColor: "#4C19A9",
                        color: "white",
                        fontSize: "10px",
                        width: "100%",
                      }}
                      target="_blank"
                      className={`${"#3F51B5"}`}
                      disabled
                    >
                      <span
                        style={{ fontWeight: "normal", paddingLeft: "-10px" }}
                      >
                        <IntlMessages id="level.test.NoPassed" />
                      </span>
                    </Button>
                  ) : (
                    <Button
                      variant="contained"
                      fullWidth={true}
                      style={{
                        borderBottomLeftRadius: "20px",
                        borderBottomRightRadius: "20px",
                        backgroundColor: "#4C19A9",
                        color: "white",
                        fontSize: "10px",
                        width: "100%",
                      }}
                      target="_blank"
                      className={`${"#3F51B5"}`}
                      onClick={this.openConfirmModal}
                    >
                      <span
                        style={{ fontWeight: "normal", paddingLeft: "-10px" }}
                      >
                        <IntlMessages id="test.level.pass" />
                      </span>
                    </Button>
                  )}
                </div>
              </div>
            </div>
          </div>
        </div>
      );
    } else {
      return (
        <div className="col-xl-3 col-md-3 col-lg-3 col-sm-6 col-12 ">
          <Exercices
            openExercices={this.state.openExercices}
            closeExerciceModal={this.closeExerciceModal}
            test={test}
            listeExercices={this.state.listeExercices}
            score={score}
          ></Exercices>
          <div
            className="card product-item  "
            style={{
              borderTopLeftRadius: "20px",
              borderTopRightRadius: "20px",
              borderBottomLeftRadius: "20px",
              borderBottomRightRadius: "20px",
            }}
          >
            <div
              className="card-header border-0 p-0"
              style={{
                borderTopLeftRadius: "20px",
                borderTopRightRadius: "20px",
              }}
            >
              <div className="card-image">
                <div className="grid-thumb-equal">
                  <span className="grid-thumb-cover jr-link">
                    <img alt="Remy Sharp" src={testImg} />
                  </span>
                </div>
              </div>
            </div>
            <div className=" d-flex flex-column bd-highlight">
              <div className="d-flex flex-row bd-highlight  d-flex justify-content-around align-items-center pt-1">
                {this.props.userProfile.role_id == roleIdParent ? (
                  <h3 style={{ fontWeight: "bold", color: "#4C19A9" }}>
                    {studentData.user.name + " " + studentData.user.surname}
                  </h3>
                ) : (
                  ""
                )}

                <div
                  className={` badge text-uppercase ${"text-white bg-success"}`}
                >
                  <IntlMessages id="level.test.score" /> : {parseInt(score)} %
                </div>
              </div>
              <div className="bd-highlight  flex-column bd-highlight">
                <div className=" bd-highlight  d-flex flex-row  justify-content-between align-items-center pl-2">
                  <h6 style={{ fontWeight: "bold", color: "#4C19A9" }}>
                    {" "}
                    <IntlMessages id="level.test.name" /> : {test.test_name}
                  </h6>
                </div>

                <div className="bd-highlight  d-flex flex-row  justify-content-between align-items-center pl-2">
                  <h6 style={{ fontWeight: "bold", color: "#4C19A9" }}>
                    <IntlMessages id="components.note.subject" /> :{" "}
                    {test.subjects.name_FR}
                  </h6>
                </div>
                <div className="bd-highlight  d-flex flex-row  justify-content-between align-items-center pl-2">
                  <h6 style={{ fontWeight: "bold", color: "#4C19A9" }}>
                    <IntlMessages id="level.test.date" />:{" "}
                    {moment(test.limit_date).format("DD/MM/YYYY")}
                  </h6>
                </div>
                <div className="bd-highlight  d-flex flex-row  justify-content-start align-items-center pl-2">
                  <h6 style={{ fontWeight: "bold", color: "#4C19A9" }}>
                    <IntlMessages id="level.test.passedDate" />:{" "}
                    {moment(passed_date).format("DD/MM/YYYY")}
                  </h6>
                </div>
              </div>
              <div className="d-flex flex-row bd-highlight  justify-content-start ml-0 ">
                <div className="d-flex flex-row  col-md-12 pl-0 pr-0 justify-content-between ">
                  <Button
                    onClick={this.openExercicesModal}
                    variant="contained"
                    fullWidth={true}
                    style={{
                      borderBottomLeftRadius: "20px",
                      borderBottomRightRadius: "20px",
                      backgroundColor: "#4C19A9",
                      color: "white",
                      fontSize: "10px",
                      width: "100%",
                    }}
                    target="_blank"
                    className={`${"#3F51B5"}`}
                  >
                    <span
                      style={{ fontWeight: "normal", paddingLeft: "-10px" }}
                    >
                      <IntlMessages id="test.level.exercices" />
                    </span>
                  </Button>
                </div>
              </div>
            </div>
          </div>
        </div>
      );
    }
  }
}

function mapStateToProps(state) {
  return {
    userProfile: state.auth.userProfile,
    classLevels: state.ClassLevels.remoteLevels,
    classSections: state.classSections.remoteSections,
    classes: state.classes,
    settings: state.settings.locale,
  };
}

export default connect(
  mapStateToProps,
  {}
)(TestStudentItem);
